window.bookSummaryJSON = "<p><b>Briella Wilson is a quiet librarian who houses two secrets. Both of which could destroy her.</b></p> <p>Unfortunately for her, two students who attend the college where she works—Grant Gipson and Jason Nani—have a taste for forbidden fruit and harbor a dark obsession for their sweet-natured college librarian. Determined to possess her before they graduate, they and their friend Trip Baniker offer her a choice: play their game or they'll expose what they've uncovered about her to the world.</p> <p>These three young men are twisted, dark, and addictive. Their game brings as much terror as it does pleasure. But toeing that line is dangerous for all of them. Will Briella manage to keep her secrets, and her heart, safe as she's forced to play their game, or will all four of them find themselves staring down the barrel of a loaded gun?</p> <p>Not a Peep <i>is a dark romance and book one of the Cracked Spines Duet. It's MMFM and has a mild cliffhanger. Contains mature content. A complete list of content warnings can be found on the author's website.</i></p>"; 
